void ReadWright(char *str) {
    char *token = strtok(str, ":\n");
//    printf("%s",token);
    while (token != NULL) {
        n++;
        strcpy(leaf_name[n], token);
        token = strtok(NULL, ":\n");
//        printf("%s",token);
        leaf_weight[n] = atoi(token);
        token = strtok(NULL, ":\n");
//        printf("%s",token);
    }
    printf("È¨ÖØÎÄ¼ş¶ÁÈ¡³É¹¦\n");
}

// Ñ¡ÔñÁ½¸ö×îĞ¡µÄ½Úµã
void select(HuffmanTree HT, int end, int *s1, int *s2) {
    int min1 = INT_MAX, min2 = INT_MAX;
    for (int i = 1; i <= end; ++i) {
        if (HT[i].parent == 0) { // Ö»¿¼ÂÇ»¹Ã»ÓĞ¸¸½ÚµãµÄ½Úµã
            if (HT[i].weight < min1) { // ÕÒµ½±Èµ±Ç°×îĞ¡»¹Ğ¡µÄ½Úµã
                min2 = min1;
                *s2 = *s1; // ¸üĞÂµÚ¶ş×îĞ¡µÄ½Úµã
                min1 = HT[i].weight;
                *s1 = i; // ¸üĞÂ×îĞ¡µÄ½Úµã
            } else if (HT[i].weight < min2) { // ÕÒµ½±ÈµÚ¶şĞ¡µÄ»¹Ğ¡£¬µ«±È×îĞ¡µÄ´óµÄ½Úµã
                min2 = HT[i].weight;
                *s2 = i;
            }
        }
    }
}

// ´´½¨¹ş·òÂüÊ÷
void Create(HuffmanTree HT) {
    // ³õÊ¼»¯¹ş·òÂüÊ÷È«²¿½Úµã
    for (int i = 1; i <= 2 * n - 1; i++) {
        HT[i].parent = HT[i].left = HT[i].right = 0;
        strcpy(HT[i].code, "\0");
        if (i <= n) {
            HT[i].weight = leaf_weight[i];
            strcpy(HT[i].name, leaf_name[i]);
        } else {
            HT[i].weight = 0;
            strcpy(HT[i].name, "\0");
        }
    }

    // ¹¹½¨¹ş·òÂüÊ÷
    for (int i = n + 1; i <= 2 * n - 1; ++i) {
        int s1, s2;
        select(HT, i - 1, &s1, &s2);     // Ñ¡ÔñÁ½¸ö×îĞ¡½Úµã
        HT[s1].parent = i;
        HT[s2].parent = i; // ÉèÖÃÑ¡ÖĞ½ÚµãµÄ¸¸½Úµã
        HT[i].left = s1;
        HT[i].right = s2; // ÉèÖÃĞÂ½ÚµãµÄ×Ó½Úµã
        HT[i].weight = HT[s1].weight + HT[s2].weight; // ĞÂ½ÚµãµÄÈ¨ÖØÊÇÁ½¸ö×Ó½ÚµãÈ¨ÖØÖ®ºÍ

    }
    printf("¹ş·òÂüÊ÷´´½¨³É¹¦\n");
}

// ½âÑ¹µÃµ½Ô­ÎÄ
void decompress(HuffmanTree HT) {
    // ´ò¿ªÎÄ¼ş
    FILE *file4 = fopen("work1.c", "rb");
    if (file4 == NULL) {
        printf("Ñ¹ËõÎÄ¼ş´ò¿ªÊ§°Ü");
        exit(1);
    }
    FILE *file5 = fopen("½âÑ¹.txt", "w");
    if (file5 == NULL) {
        printf("½âÑ¹ÎÄ¼ş´ò¿ªÊ§°Ü");
        exit(1);
    }

    // Öğ×Ö½âÑ¹
    int current = 2 * n - 1;  // ´Ó¹ş·òÂüÊ÷µÄ¸ù½Úµã¿ªÊ¼
    char ch;
    while (fread(&ch, sizeof(ch), 1, file4) > 0) {
        for (int i = 7; i >= 0; --i) {
            if ((ch >> i) & 1) {  // ¶ÁÈ¡Ò»¸ö±ÈÌØ
                current = HT[current].right;  // Èç¹ûÎª1£¬ÒÆ¶¯µ½ÓÒº¢×Ó
            } else {
                current = HT[current].left;  // Èç¹ûÎª0£¬ÒÆ¶¯µ½×óº¢×Ó
            }
            if (current <= n) {  // µ½´ïÒ¶×Ó½Úµã£¬Êä³ö¶ÔÓ¦×Ö·û
                if (strcmp(HT[current].name, "^") == 0) {
                    fprintf(file5, "\u3000");
                } else if (strcmp(HT[current].name, "*") == 0) {
                    fprintf(file5, " ");
                } else if (strcmp(HT[current].name, "+") == 0) {
                    fprintf(file5, "\n");
                } else {
                    fprintf(file5, "%s", HT[current].name);
                }
                current = 2 * n - 1;  // ´Ó¸ù½ÚµãÖØĞÂ¿ªÊ¼
            }
        }
    }

    //¹Ø±ÕÎÄ¼ş
    fclose(file4);
    fclose(file5);
    printf("½âÑ¹³É¹¦\n");
}

// ÏÔÊ¾¹ş·òÂüÊ÷Êı×é
void DisplayHuffmanTree(HuffmanTree HT) {
    printf("Ë÷Òı\t×Ö·û\tÈ¨ÖØ\t×óº¢×Ó\tÓÒº¢×Ó\t¸¸½Úµã\t¹ş·òÂü±àÂë\n");
    for (int i = 1; i <= 2 * n - 1; ++i) { // ±éÀú´òÓ¡Ã¿¸ö½Úµã
        printf("%d\t%s\t%d\t%d\t%d\t%d\t%s\n", i, HT[i].name, HT[i].weight, HT[i].left, HT[i].right,
               HT[i].parent, HT[i].code);
    }
}

